import React from "react";
import { Row, Col, Button } from "reactstrap";
import south from "../images/southindian.jfif";
import image from "../images/cafee.jpg";
import chole from "../images/chole.jpg";
import biryani from "../images/biryani.jpg";
const Main = (props) => {
  return (
    <div>
      <Row noGutters className="text-center align-items-center">
        <Col className="name">The Taste of India</Col>
      </Row>
      <Row noGutters className="text-center align-items-center pizza-cta">
        <Col>
          <p className="looking-for-pizza text-muted">
            <i>One stop destination for Great Indian Food</i>
            <i className="fas fa-pizza-slice pizza-slice"></i>
          </p>
        </Col>
      </Row>
      <div className="container text-center">
        <div className="row" style={{ paddingTop: "10px" }}>
          <div className="col-lg-4">
            <img
              src={south}
              alt="cafe"
              className="big-img"
              style={{ width: "21em", height: "13em" , borderRadius:"50%"}}
            />
          </div>
          <div className="col-lg-4">
            <img
              src={biryani}
              alt="cafe"
              className="big-img"
              style={{ width: "20em", height: "13em" , borderRadius:"50%",opacity:"0.6"}}
            />
          </div>
          <div className="col-lg-4">
            <img
              src={chole}
              alt="cafe"
              className="big-img"
              style={{ width: "21em", height: "13em" , borderRadius:"50%"}}
            />
          </div>
        </div>
      </div>
      <Row noGutters className="text-center align-items-center pizza-cta">
        <Col>
          <Button
            color="none"
            className="book-table-btn"
            onClick={(_) => {
              props.setPage(1);
            }}
          >
            Book a Table
          </Button>
        </Col>
      </Row>
      <Row noGutters className="text-center big-img-container">
        <Col>
          <img
            src={image}
            alt="cafe"
            className="big-img"
            style={{ background: "transparent", opacity: "0.7" }}
          />
        </Col>
      </Row>

      <div class="container">
        <img className="big-img" src={image} alt="Snow" style={{ width: "100%" ,background: "transparent", opacity: "0.7" }} />
        <button className="btn" >Button</button>
      </div>
    </div>
  );
};

export default Main;
